    std::unordered_map<std::string, std::pair<AddressInfo, double>> output;
    for (auto inp : str_lst)
    {
        try
        {
            auto start = std::chrono::high_resolution_clock::now();
            AddressInfo res =
                extract_addr_info_parts_from_raw(inp);
            auto end = std::chrono::high_resolution_clock::now();
            std::chrono::duration<double> duration = end - start;
            output[inp] = std::make_pair(res, duration.count());
        }
        catch (std::exception &e)
        {
            std::cout << "Exception occurred: " << e.what() << std::endl;
        }
    }

    // export results
    std::ofstream outputFile("results_final.csv");

    if (!outputFile)
    {
        std::cerr << "Failed to open the output file." << std::endl;
        return 1;
    }

    // Write the header row
    outputFile << "Address,Tinh,Huyen,Xa,ThoiGian" << std::endl;

    // Write each result to the file
    for (const auto &_pair : output)
    {
        std::string address = _pair.first;
        std::pair<AddressInfo, double> result = _pair.second;
        outputFile << '"' << address << '"' << "," << '"' << result.first.tinh << '"' << "," << '"' << result.first.quan_huyen << '"' << "," << '"' << result.first.xa_phuong << '"' << "," << '"' << result.second << '"' << std::endl;
    }

    // Close the output file
    outputFile.close();

    std::cout << "Results exported to results.csv." << std::endl;

    return 0;
